import React from "react";
import Heading from "./Heading";
import Para from "./Para";
import Lists from "./Lists";
const App = () => {
  return (
    <React.Fragment>
      <Heading />
      <Para />
      <Lists />
    </React.Fragment>
  );
};
export default App;
